import './App.css';
import First from './Components/First';
import Second from './Components/Second';




function App() {
  return (
    <div className="App">
   <img src = "/images/Figma.png" className = "img" alt = ""  />
   <p className = "para">Illustration</p>
   <p className = "para1">24 lessons</p>
   <p className = "para2">134 min</p>
   <svg width="84" height="75" viewBox="0 0 84 75" fill="none" xmlns="http://www.w3.org/2000/svg">
<rect width="84" height="75" rx="16" fill="white" fill-opacity="0.4"/>
</svg>


      <First />
      <Second />

    </div>
  );
}

export default App;
